import React from "react";

// I want my all my post to show here that i created in posts.js.
// be able to delete it (if my authorized)
const Profile = ({token,comment, setComment, userName}) =>{

    return (
        <>
            <div id="profile-container">
                <h1 id="profile-title">WELCOME {userName}</h1>
                <h2>My Posts</h2>
                <h2>SENT MESSAGES</h2>
                <h2>RECEIVED MESSAGES</h2>
            </div>

        </>
    )

}


export default Profile
